import { Login } from './componets/login';
import { RegisterPage } from './componets/register';
import { Home } from './componets/homePage.js';

export const ROUTES = [
    { path: '/homePage', component: Home },
    { path: '/register', component: RegisterPage },
    { path: '/', component: Login }
]
